import React, {useState} from "react";
import { Switch, Route } from "react-router-dom";
import {CSSTransition, TransitionGroup} from "react-transition-group";
import HeaderOld from "./HeaderOld";
import Header from "./Header";
import Register from "./Register";
import Login from "./Login";
import Option from "./Option";
import Lookup from "./Lookup";
import LookupTable from "./LookupTable";
import Info from "./Info";
import Payment from "./Payment";

// ADD NAV BAR

const App = () => (
    <div>
        <Header />
        <Main />
    </div>
    );

//Need to add transitions...
// // Use this link: https://reactcommunity.org/react-transition-group/with-react-router

// const routes = [
//     { path: "/login", name: "Login", Component: Login },
//     { path: "/option", name: "Option", Component: Option },
// ]

const Main = () => (
    <Switch>
        <Route exact path="/" component={Login}></Route>
        <Route exact path="/register" component={Register}></Route>
        <Route exact path="/login" component={Login}></Route>
        <Route exact path="/option" component={Option}></Route>
        <Route exact path="/lookup" component={Lookup}></Route>
        <Route exact path="/lookuptable" component={LookupTable}></Route>
        <Route exact path="/info" component={Info}></Route>
        <Route exact path="/payment" component={Payment}></Route>
    </Switch>
    );

export default App;
